import './App.css';

const data = [
    {title: 'Сделать',
    items: [
        {
            id: 1,
            description: 'Сходить в тренажёрку',
        },
        {
            id: 2,
            description: 'Сходить в магазин',
        },
        {
            id: 3,
            description: 'Забрать Артёма из садика',
        }
    ]},
    {title: 'Сегодня',
    items: [
    {
        id: 4,
        description: 'Сделать задание по программированию',
    },
    {
        id: 5,
        description: 'Купить варочную панель',
    },
    ]}
]


function App() {
  return (
    <div className="App">
      <header className="App-header">
          <div className="board">
              {data.map((grp, grpI) => (
                  <div key={grp.title} className="group">
                      <div className="title">{grp.title}</div>
                      {grp.items.map((item, itemI) => (
                          <div key={item.id} className="item">
                              <div>
                                  <p>{item.description}</p>
                              </div>
                          </div>
                      ))}
                  </div>
              ))}
          </div>
      </header>
    </div>
  );
}

export default App;
